package io.nuls.parse;

import io.nuls.base.data.Block;
import io.nuls.base.data.CoinData;
import io.nuls.base.data.Transaction;
import io.nuls.core.constant.TxType;
import io.nuls.core.crypto.HexUtil;
import io.nuls.core.exception.NulsException;
import io.nuls.crosschain.model.bo.txdata.CrossTxData;

public class CrossChainTxParseTest {
    public static void main(String[] args) throws NulsException {
    crossIn(null);crossOut(null);
    }
    public static void crossIn(String[] args) throws NulsException {
        String blockHex = "";
        Block block = new Block();
        block.parse(HexUtil.decode(blockHex), 0);
        for (Transaction tx : block.getTxs()) {
            if (tx.getType() != TxType.CROSS_CHAIN) {
                continue;
            }
            CrossTxData txData = new CrossTxData();
            txData.parse(tx.getTxData(), 0);
            CoinData coinData = tx.getCoinDataInstance();
            System.out.println(txData.getOriginalTxHash());
        }
    }

    public static void crossOut(String[] args) throws NulsException {
        String blockHex = "";
        Block block = new Block();
        block.parse(HexUtil.decode(blockHex), 0);
        for (Transaction tx : block.getTxs()) {
            if (tx.getType() != TxType.CROSS_CHAIN) {
                continue;
            }
            CrossTxData txData = new CrossTxData();
            txData.parse(tx.getTxData(), 0);
            CoinData coinData = tx.getCoinDataInstance();
            System.out.println(txData.getOriginalTxHash());
        }
    }
}
